    const showOid = async (id) => {
        console.log("TESTESTESTE")

        const setData = async () => {
            try {
                async function fetchOid() {
                    const response = await fetch(`http://localhost:3001/orders/api/v1/ordet/${String(ord.id)}`);
                    const data = await response.json();
                    console.log(data.rows);
                    //await setSearch(data.rows);
                    console.log(ord.id);
                    console.log(search);

                }
                fetchOid();
            } catch (error) {     
            }
        }
        console.log(search);
        //setSearch((ord).filter(ord=>ord.id == id));
        setData();

    }



    return (
        <>
            <div className="container" style={{color: "black"}} >

                <button type="button" className="btn btn-info" onClick={() => showOid(ord.id)} data-toggle="modal" data-target="#myModal">
                    Items
                </button>

                <div className="modal fade" id="myModal">
                    <div className="modal-dialog modal-lg">
                    <div className="modal-content">


                        <div className="modal-header">
                        <h4 className="modal-title">Order Items</h4>
                        <button type="button" className="close" data-dismiss="modal">&times;</button>
                        </div>


                        <div className="modal-body">
                            <table className="table table-striped">
                            <thead>
                                <tr>
                                    <th>Product</th>
                                    <th>Quantity</th>
                                    <th>Unit Price</th>
                                    <th>Subtotal</th>
                                </tr>
                                </thead>
                                <tbody>
                                    {search && search.map((sch) => {
                                            return (                                            
                                                <tr key = {sch.id}>
                                                    <td>{sch.prod_name}</td>
                                                    <td>{sch.quantity}</td>
                                                    <td>{sch.price}</td>
                                                    <td>{sch.subtotal}</td>
                                                </tr>                
                                            );
                                    })}                               
                            </tbody>
                            </table>
                        </div>

                        <div className="modal-body">
                            <h5 className="modal-title">Edit Quantity</h5>
                            <div className="input-group col-md-4 m-1">
                                        <input className="form-control py-2 border-right-0 border" type="search" placeholder="search" onChange={e=>{setSearch(e.target.value)}} id="example-search-input"/>
                                        <span className="input-group-append">
                                            <button className="btn btn-outline-secondary border-left-0 border" type="button">
                                                <i className="fa fa-search"></i>
                                            </button>
                                        </span>
                            </div> 
                            <table className="table">
                                <thead>
                                <tr>
                                    <th>Prod Name</th>
                                    <th>Quantity</th>
                                    <th>Unit Price</th>
                                    <th>Subtotal</th>
                                </tr>
                                </thead>
                                <tbody>
                                <tr>
                                    <td>Coca-cola 2L</td>
                                    <td>10</td>
                                    <td>7.50</td>
                                    <td>75.00</td>
                                </tr>                                    
                                </tbody>
                            </table>
                        </div>

                        <div className="modal-footer">
                            <div className="container">
                                <button type="button" className="btn btn-success m-1" data-dismiss="modal">Ok</button>
                                <button type="button" className="btn btn-secondary m-1" data-dismiss="modal">Close</button>
                            </div>

                        </div>

                    </div>
                    </div>
                </div>

            </div>


        </>

    );

};

export default OrderDetail;
